class t extends HTMLElement {
    renderItem(t) {
        return `<n-card campaign_id="${this.getAttribute(`card_${t}_campaign_id`)}" campaign_name="${this.getAttribute(`card_${t}_campaign_name`)}"\n                campaign_creative="${this.getAttribute(`card_${t}_campaign_creative`)}" campaign_position="${this.getAttribute(`card_${t}_campaign_position`)}"\n                background_mobile="${this.getAttribute(`card_${t}_background_mobile`)}"\n                background_desktop="${this.getAttribute(`card_${t}_background_desktop`)}"\n                contrast="${this.getAttribute(`card_${t}_contrast`)}" align_mobile="${this.getAttribute(`card_${t}_align_mobile`)}" heading="${this.getAttribute(`card_${t}_heading`)||""}"\n                description="${this.getAttribute(`card_${t}_description`)||""}" cta_style="${this.getAttribute(`card_${t}_cta_style`)}" cta_text="${this.getAttribute(`card_${t}_cta_text`)||""}"\n                cta_link="${this.getAttribute(`card_${t}_cta_link`)||""}"\n                popin_id="${this.getAttribute(`card_${t}_popin_id`)||""}"\n                popin_text="${this.getAttribute(`card_${t}_popin_text`)||""}"></n-card>`
    }
    renderContainer() {
        return "" + ["a", "b", "c"].map(t => this.renderItem(t)).join("")
    }
    render() {
        this.classList.add("c-CardsContainer");
        const t = this.getAttribute("background_color");
        this.innerHTML = `<n-zone background_color="${t}" align="center" container="true">\n                               ${this.renderContainer()}\n                          </n-zone>`
    }
    connectedCallback() {
        this.render()
    }
}
customElements.get("n-cards-container") || customElements.define("n-cards-container", t);
export default t;